import React from 'react';
import ReactDOM from 'react-dom';
import logo from './GitHub-Mark.png';
import './index.css';


import { useState } from 'react';



function Contributors() {

    const [contributors, setContributors] = useState([]);

    const handleChange = (e,index) => {
        const updatedContributors = [...contributors];
        updatedContributors[index] = e.target.value;
        setContributors(updatedContributors);
    };
    const handleRest= (e) => {
        e.preventDefault();
        const formValues = {
            contributors_name: contributors.join(","),
        };
        fetch('http://localhost:5000/api/contributors', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formValues),
        })
            .then((response) => response.json())
            .then((result) => {
                if (result['status'] === 'success') {

                }
            })
            .catch((error) => {
                console.error(error);
            });
    }

    const onClickEvent = () => {
        setContributors([...contributors, ""]);
    };

    return (
        <div>
            <form onSubmit={handleRest}>
                <div>
                    {contributors.map((contributor, index) => (
                        <div key={index}>
                            <label htmlFor={`contributors_name_${index}`}>Contributor's name:</label>
                            <input
                                type = "text"
                                id = "contributors_name"
                                name = {`contributors_name_${index}`}
                                value = {contributor}
                                onChange = {(e) => handleChange(e, index)}
                            />
                        </div>
                    ))}
                </div>
                <br />
                <input type="button" value="Add Contributor" onClick={onClickEvent} />
                <br />
                <input type="submit" value="Submit" onClick={handleRest}/>
            </form>
        </div>
    );

}


function AddFiles() {

    const [showOtherComponent, setShowOtherComponent] = useState(false);

    const [formValues, setFormValues] = useState({
        language: '',
        readme: '',
        readme_content: '',
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormValues((prevValues) => ({
            ...prevValues,
            [name]: value,
        }));
    };
    const handleRest= (e) => {
        e.preventDefault();
        fetch('http://localhost:5000/api/create-files', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formValues),
        })
            .then((response) => response.json())
            .then((result) => {
                if (result['status'] === 'success') {
                    setShowOtherComponent(true);
                }
            })
            .catch((error) => {
                console.error(error);
            });
        }

    const onClickEvent = (e) => {
        document.getElementById("readme_content").style.visibility = "visible";
        formValues.readme = "True";
    }

    return (
        <div>
            <form onSubmit={handleRest}>
                <label htmlFor="languae">Language:</label>
                <input
                    type="text"
                    id="language"
                    name="language"
                    onChange={handleChange}
                    required
                />
                <br />
                <label htmlFor="readme">Click to add README</label>
                <input
                    type={"button"}
                    id = "readme"
                    name = "readme"
                    onClick = {onClickEvent}
                />
                <br />
                <label htmlFor="readme_content">Readme content:</label>
                <input
                    type="text"
                    id="readme_content"
                    name="readme_content"
                    onChange={handleChange}
                    style={{visibility: "hidden"}}
                />
                <br />
                <input type="submit" value="Submit" />
                {showOtherComponent ? <Contributors/> : null}

            </form>
        </div>
    );
}

function App() {
    const [formValues, setFormValues] = useState({
        repo_name: '',
        repo_description: '',
        repo_private: '',
    });
    const [showOtherComponent, setShowOtherComponent] = useState(false);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormValues((prevValues) => ({
            ...prevValues,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        fetch('http://localhost:5000/api/create-repo', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formValues),
        })
            .then((response) => response.json())
            .then((result) => {
                if (result['status'] === 'success') {
                    setShowOtherComponent(true);

                }
            })
            .catch((error) => {
                console.error(error);
            });
    };

    return (
        <div className="App">
            <nav className="Nav">
                <img src={logo} className="Nav-logo" alt="logo" width={90} />
                <h1 className="Header">Create your Github Repo</h1>
            </nav>
            <form className={Repo} onSubmit={handleSubmit} >
                <label htmlFor="repo_name">Repo name:</label>
                <input
                    type="text"
                    id="repo_name"
                    name="repo_name"
                    onChange={handleChange}
                    required
                />
                <br />
                <label htmlFor="repo_description">Repo description:</label>
                <input
                    type="text"
                    id="repo_description"
                    name="repo_description"
                    onChange={handleChange}
                    required
                />
                <br />
                <label htmlFor="repo_private">Repo private (Y/n):</label>
                <input
                    type="text"
                    id="repo_private"
                    name="repo_private"
                    onChange={handleChange}
                    required
                />
                <br />
                <input type="submit" value="Create Repo" />
            </form>
            {showOtherComponent ? <AddFiles/> : null}
        </div>
    );
}

export default App;



ReactDOM.render(<App/>,document.getElementById('root'));
